import ListingView from '../views/ListingView';
import EntryView from '../views/EntryView';
import SearchView from '../views/SearchView';

const routes = [
    {
        path: '/search',
        component: SearchView,
        exact: true
    },
    {
        path: '/listing',
        component: ListingView,
        exact: true
    },
    {
        path: '/register',
        component: EntryView,
        exact: true
    }
];

export default routes;
